function praviPdf(){
    var doc = new jsPDF();
    doc.setFontSize(35);
    doc.text(30, 30, 'Podaci');
    doc.setLineWidth(0.7);
    doc.setDrawColor(140, 140, 140);
    doc.line(25, 35, 150, 35, 'F');
    doc.setFontSize(16);
    doc.text(115, 15, "Kupac: " + podaci.ime_kupca + " " + podaci.prezime_kupca);
    doc.text(115, 24, "Datum kupovine: " + ispisiDatum(danasnji_datum()) + "." );
    var donji = 60;
    doc.setFontSize(20);
    doc.text(30, donji, podaci.let1.vreme + ", " + podaci.let1.datum);
    doc.text(40, donji + 10, "-"+podaci.grad1.ime);
    if(podaci.broj == 3) {
        donji += 29;
        doc.text(30, donji, podaci.let2.vreme + ", " + podaci.let2.datum);
        doc.text(40, donji + 10, "-"+podaci.grad2.ime);
    }
    donji += 20;
    if(podaci.fir.kol > 0) {
        donji += 10;
        doc.text(35, donji, "Broj karata prve klase: " + podaci.fir.kol);
    }
    if(podaci.bus.kol > 0) {
        donji += 10;
        doc.text(35, donji, "Broj karata biznis klase: " + podaci.bus.kol);
    }
    if(podaci.eco.kol > 0) {
        donji += 10;
        doc.text(35, donji, "Broj karata ekonomske klase: " + podaci.eco.kol);
    }
    donji += 15;
    doc.text(35, donji, "Ukupna vrednost karata: " + podaci.cena + " RSD");
    var imgData = 'data:image/png;base64,'
    doc.addImage(imgData, 'PNG', 7, 7, 10, 10);
    doc.setFontSize(15);
    doc.text(20,14, "Delta Air");
    return doc;
}